    public static String[] getMultiPinyin(String hanzi, String pinyin, boolean isDialMap, boolean isOrig) {
        String[] ret = null;
        SparseArray<byte[][]> mMultiPinyinMap = new SparseArray();
        if (!(hanzi == null || pinyin == null)) {
            int i;
            String[][] pinyinArray = new String[20][];
            mMultiPinyinMap.clear();
            int hanziCount = 0;
            int pinyinCount = 0;
            int count = -1;
            char[] hanziChar = hanzi.toCharArray();
            int hanziLen = hanzi.length();
            for (i = 0; i < hanziLen; i++) {
                char c = hanziChar[i];
                boolean isChinese = SortUtils.isChinese(c);
                if (isBlank(c, isOrig)) {
                    if (i > count + 1) {
                        hanziCount++;
                    }
                    count = i;
                } else if (isChinese) {
                    if (i > count + 1) {
                        hanziCount++;
                    }
                    hanziCount++;
                    Object multiPinyin = (byte[][]) mMultiPinyin.get(Character.valueOf(c));
                    if (multiPinyin != null) {
                        mMultiPinyinMap.put(hanziCount - 1, multiPinyin);
                    }
                    count = i;
                } else if (i == hanziLen - 1) {
                    hanziCount++;
                }
            }
            if (mMultiPinyinMap.size() == 0) {
                return null;
            }
            int preBlankPos = -1;
            int preMultiPos = -1;
            int pinyinStrLen = pinyin.length();
            int arrayIndex = 0;
            char[] pinyinChar = pinyin.toCharArray();
            i = 0;
            while (i < pinyinStrLen) {
                boolean isCurCharBlank = isBlank(pinyinChar[i], isOrig);
                boolean isNextCharBlank = i < pinyinStrLen + -1 ? isBlank(pinyinChar[i + 1], isOrig) : !isCurCharBlank;
                if (isCurCharBlank && !r16) {
                    preBlankPos = i;
                    if (i == pinyinStrLen - 1) {
                        pinyinArray = SortUtils.addToStringArray(pinyinArray, SortUtils.addNewData(null, pinyin.substring(preMultiPos + 1, i + 1)), pinyinArray.length, arrayIndex);
                        arrayIndex++;
                    }
                } else if (!isCurCharBlank && r16) {
                    pinyinCount++;
                    byte[][] multiPinyin2 = (byte[][]) mMultiPinyinMap.get(pinyinCount - 1);
                    if (multiPinyin2 != null) {
                        if (!(preMultiPos == -1 && preBlankPos == -1)) {
                            pinyinArray = SortUtils.addToStringArray(pinyinArray, SortUtils.addNewData(null, pinyin.substring(preMultiPos + 1, preBlankPos + 1)), pinyinArray.length, arrayIndex);
                            arrayIndex++;
                        }
                        String currentPinyin = pinyin.substring(preBlankPos + 1, i + 1);
                        String[] aMultiPinyin = SortUtils.addNewData(null, currentPinyin);
                        for (int j = 0; j < multiPinyin2.length; j++) {
                            String data;
                            if (isDialMap) {
                                data = DialerHighlighter.convertToDialMap(new String(multiPinyin2[j], Charset.defaultCharset()));
                            } else {
                                data = new String(multiPinyin2[j], Charset.defaultCharset());
                            }
                            if (!currentPinyin.equalsIgnoreCase(data)) {
                                aMultiPinyin = SortUtils.addNewData(aMultiPinyin, data);
                            }
                        }
                        pinyinArray = SortUtils.addToStringArray(pinyinArray, aMultiPinyin, pinyinArray.length, arrayIndex);
                        arrayIndex++;
                        preMultiPos = i;
                    } else if (i == pinyinStrLen - 1) {
                        pinyinArray = SortUtils.addToStringArray(pinyinArray, SortUtils.addNewData(null, pinyin.substring(preMultiPos + 1, i + 1)), pinyinArray.length, arrayIndex);
                        arrayIndex++;
                    }
                }
                i++;
            }
            if (pinyinCount != hanziCount) {
                HwLog.e("MultiPinyin", "the size of name and pinyin not match, pinyinCount is " + pinyinCount + ", hanziCount is " + hanziCount);
                return null;
            }
            ret = getCombination(SortUtils.expandStringArrayCapacity(pinyinArray, arrayIndex));
        }
        return ret;
    }

    private static boolean isBlank(char c, boolean isOrig) {
        boolean z = true;
        boolean z2 = false;
        if (isOrig) {
            if (!Character.isLetterOrDigit(c)) {
                z2 = true;
            }
            return z2;
        }
        if (c != ' ') {
            z = false;
        }
        return z;
    }

    public static String[] getCombination(String[][] str) {
        int i;
        int strLen = str.length;
        int count = -1;
        int[] idx = new int[strLen];
        int max_combination_count = 1;
        for (i = 0; i < strLen; i++) {
            if (str[i].length > 0 && max_combination_count <= 48) {
                max_combination_count *= str[i].length;
            }
        }
        if (max_combination_count > 48) {
            max_combination_count = 48;
        }
        String[] ret = new String[max_combination_count];
        StringBuilder sb = new StringBuilder();
        while (idx[0] < str[0].length) {
            if (count >= 0) {
                sb.setLength(0);
                for (i = 0; i < strLen; i++) {
                    sb.append(str[i][idx[i]]);
                }
                ret[count] = sb.toString();
            }
            count++;
            if (count == max_combination_count) {
                break;
            }
            int i2 = strLen - 1;
            idx[i2] = idx[i2] + 1;
            i = strLen - 1;
            while (i > 0 && idx[i] == str[i].length) {
                idx[i] = 0;
                i2 = i - 1;
                idx[i2] = idx[i2] + 1;
                i--;
            }
        }
        return (String[]) Arrays.copyOf(ret, count);
    }
